import React from 'react';
import { Link } from 'react-router-dom';




function Navbar() {
  return (


<div>
<nav class="navbar navbar-inverse navbar-fixed-top navbar-collapse" id="head-navbar">

    <Link className="text-white text-lg brand-text navbar-brand" to="/">
            <img src="https://lajoyalink.com/wp-content/uploads/2018/03/Movie.jpg" height="130" class="d-inline-block align-top  border border-white rounded "/> 
            </Link>

    <ul class="nav navbar-nav">
      <li class="active"><a href="#">Home</a></li>
      <li><a href="#">Page 1</a></li>
      <li><a href="#">Page 2</a></li>
    </ul>
  <ul class="nav navbar-nav navbar-right">
      <li><a href="#"><span class="glyphicon glyphicon-user"></span> Sign Up</a></li>
      <li><a href="#"><span class="glyphicon glyphicon-log-in"></span> Login</a></li>
    </ul>
</nav>
</div>


  );
}




export default Navbar;
